import React from 'react'
import {tochi} from '../images'

function Ai() {
  return (
    <div className='p-3 m-5 bg-slate-600 w-[280px]'>
     <div className="w-12 h-12 rounded-full overflow-hidden"> 
    <img className='object-cover mb-2 w-full' src={tochi} alt="" /> 
    </div>
    </div>
  )
}

export default Ai
